import { NavLink } from "react-router-dom";

const DUMMY_DATA = [
  { id: "e1", title: "Event 1" },
  { id: "e2", title: "Event 2" },
  { id: "e3", title: "Event 3" },
  { id: "e4", title: "Event 4" },
];

export function EventsPage() {
  return (
    <>
      <h1>My Events Page</h1>
      <ul>
        {DUMMY_DATA.map((event) => (
          <li key={event.id}>
            <NavLink to={event.id}>{event.title}</NavLink>
          </li>
        ))}
      </ul>
    </>
  );
}
